  def test_SBML_parseL3Formula_arguments
    r = "sin(x,y)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'sin(x,y)' at position 8:  The function 'sin' takes exactly one argument, but 2 were found." == error ))
    r = "delay(x)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'delay(x)' at position 8:  The function 'delay' takes exactly two arguments, but 1 were found." == error ))
    r = "piecewise()".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'piecewise()' at position 11:  The function 'piecewise' takes at least one argument, but none were found." == error ))
    r = "gt(x)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'gt(x)' at position 5:  The function 'gt' takes at least two arguments, but 1 were found." == error ))
    r = "minus()".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'minus()' at position 7:  The function 'minus' takes exactly one or two arguments, but 0 were found." == error ))
    r = "root(x, y, z)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'root(x, y, z)' at position 13:  The function 'root' takes exactly one or two arguments, but 3 were found." == error ))
    r = "power()".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'power()' at position 7:  The function 'power' takes exactly two arguments, but 0 were found." == error ))
    r = "rateOf()".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'rateOf()' at position 8:  The function 'rateOf' takes exactly one argument, but 0 were found." == error ))
    r = "rateOf(a, b)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'rateOf(a, b)' at position 12:  The function 'rateOf' takes exactly one argument, but 2 were found." == error ))
    r = "rateOf(1.3)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'rateOf(1.3)' at position 11:  The function 'rateOf' takes exactly one argument, which must be the identifier of an element in the model." == error ))
    r = "rateOf(a+b)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'rateOf(a+b)' at position 11:  The function 'rateOf' takes exactly one argument, which must be the identifier of an element in the model." == error ))
    r = "quotient(1,2,3)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'quotient(1,2,3)' at position 15:  The function 'quotient' takes exactly two arguments, but 3 were found." == error ))
    r = "rem()".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'rem()' at position 5:  The function 'rem' takes exactly two arguments, but 0 were found." == error ))
    r = "implies(a)".parseL3Formula()
    assert( r == nil )
    error = .getLastParseL3Error()
    assert ((  "Error when parsing input 'implies(a)' at position 10:  The function 'implies' takes exactly two arguments, but 1 were found." == error ))
  end

