    assert( r.getType() == LibSBML::AST_FUNCTION_LOG )
    assert( r.getNumChildren() == 2 )
    c = r.getLeftChild()
    assert( c.getType() == LibSBML::AST_INTEGER )
    assert( c.getInteger() == 10 )
    assert( c.getNumChildren() == 0 )
    c = r.getRightChild()
